window.bookSummaryJSON = "<p><b>Players gonna play, but can a wild, untamable alpha billionaire player fall in love?</b></p> <p><i>Banking the Billionaire</i>: With a thriving photography career that allows her to travel all over the world and capture the hottest of men behind her camera lens, Cassie Phillips is the woman who can't be tamed. At six-foot-five, with muscles for days, and that perfect playful smile, Thatcher Kelly is the kind of man you don't want to deny. The two unlikeliest of people may be the only ones to see that some personality traits only run skin-deep.</p> <p><i>Banking Her</i>: Thatch and Cassie have finally found their perfect balance of good and sweet, crazy and playful, and, most importantly, hot and insatiable. But what happens when they're faced with a surprise neither of them plotted or schemed?</p> <p><i>Crazy Fluffing Love</i>: My pregnant wife, Cassie - whose hormones are swinging like a fluffing pendulum - has decided that we need a honeymoon. Right the F now. She wants us to go on a celebratory \"spring break\" we-just-got-married vacation to none other than Panama City Beach, Florida. But the only problem is, it's October, my crazy-hot wife is pregnant, and things are starting to get really fluffing weird.</p> <p><b>Contains mature themes.</b></p>"; 
